import React, {Component} from 'react';

class HostAttendantSummary extends  Component{
    render(){
        return(
            <div class="block-container table-list">
                <div class="row">
                    <div class="col-sm-12 col-md-12 col-lg-12"><h3>活動人數統計：</h3></div>
                </div>
                <div class="row table-border">
                    <div class="col-sm-12 col-md-12 col-lg-12">共：<span id="tol_signin" class="num-line">150</span>位 (大人 <span class="num-line" id="tol_adult">116</span>位、小孩 <span class="num-line" id="tol_kids">34</span>位)</div>
                </div>
                <div class="row table-border">
                    <div class="col-sm-6 col-md-6 col-lg-6">乾： <span id="tol_male" class="num-line">27</span>位</div>
                    <div class="col-sm-6 col-md-6 col-lg-6">坤： <span id="tol_female" class="num-line">89</span>位</div>
                    <div class="col-sm-6 col-md-6 col-lg-6">童： <span id="tol_boy" class="num-line">14</span>位</div>
                    <div class="col-sm-6 col-md-6 col-lg-6">女： <span id="tol_girl" class="num-line">20</span>位</div>
                </div>
                <div class="row">
                    <div class="col-sm-12 col-md-12 col-lg-12">非班員： <span id="tol_signin_others" class="num-line">00</span>位</div>
                </div>
            </div>
        );
    }
}

export default HostAttendantSummary;
